script: |
  super -f text -I q7630.spq | sort > q7630.out

inputs:
  - name: q7630.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT 76 NOT BETWEEN - col2 AND ( + 79 / col1 - - col2 * + col1 );
  - name: tab0

outputs:
  - name: q7630.out
    data: |
      15	81	47
      87	21	10
      97	1	99
